$(document).ready(function(){var e=$("#blast-results");$.ajax({type:"POST",url:BLAST_ENDPOINT,data:PARAMS,success:function(t){document.title="BLAST complete";e.html(t)},error:function(t,n,r){console&&console.error(t,n,r);document.title="BLAST search error. Code "+t.status;var i="";if(t.status==400)e.html(t.responseText);else{i="<p>"+t.status+": "+t.statusText+'</p><p>Please <a href="#" class="back-link">go back</a> and retry your request, if the problem persists please contact the administrator.</p>';var s='<div class="alert alert-warning alert-block"><strong>Oops! An error has occured</strong>'+i+'</div><div class="accordion" id="errorMessages"><div class="accordion-group"><div class="accordion-heading"><a class="accordion-toggle" data-toggle="collapse" data-parent="#errorMessages" href="#errMsg">Error Message</a></div><div id="errMsg" class="collapse accordion-body out"><div class="accordion-inner"><pre>'+t.responseText+"</pre></div></div></div></div>";e.html(s)}},dataType:"html"});$(".container-fluid").on("click",".back-link",function(){window.history.back();return!1});$(document).ajaxStart(function(){console.log("ajax start");document.title="BLAST started..."})});